import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import { FaFacebook, FaGoogle, FaTwitter } from 'react-icons/fa';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import Dashboard from './Dashboard';

const Authentication = ({ onLoginSuccess }) => {
    const [isLogin, setIsLogin] = useState(true);
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [name, setName] = useState('');
    const [phoneNo, setPhoneNo] = useState('');
    const [location, setLocation] = useState('');
    const navigate = useNavigate();

    const handleLogin = async (e) => {
        e.preventDefault();
        try {
            const response = await axios.post('http://localhost:8090/api/v1/customers/login', { email, password });
            console.log('Login successful', response.data);
            toast.success('Login successful!');
            onLoginSuccess(response.data);
        } catch (error) {
            console.error('Login failed', error.response.data);
            toast.error('Invalid email or password');
        }
    };

    const handleSignup = async (e) => {
        e.preventDefault();
        const customer = { name, email, phone_no: phoneNo, location, password };
        try {
            await axios.post('http://localhost:8090/api/v1/customers', customer);
            toast.success('Sign up successful! Please login.');
            setIsLogin(true);
        } catch (error) {
            console.error('Sign up failed', error.response.data);
            toast.error('Sign up failed');
        }
    };

    return (
        <div className="min-h-screen flex flex-col justify-center items-center bg-gray-900">
            <div className="w-full max-w-md p-8 bg-gray-800 rounded-lg shadow-md">
                <h2 className="text-center text-2xl font-bold mb-6 text-white">
                    {isLogin ? 'Login' : 'Sign Up'}
                </h2>
                <form onSubmit={isLogin ? handleLogin : handleSignup}>
                    {!isLogin && (
                        <>
                            <div className="mb-4">
                                <label className="block text-gray-300">Name</label>
                                <input
                                    type="text"
                                    className="w-full px-4 py-2 bg-gray-700 text-white border border-gray-600 rounded-lg mt-1"
                                    value={name}
                                    onChange={(e) => setName(e.target.value)}
                                    required
                                />
                            </div>
                            <div className="mb-4">
                                <label className="block text-gray-300">Phone No</label>
                                <input
                                    type="text"
                                    className="w-full px-4 py-2 bg-gray-700 text-white border border-gray-600 rounded-lg mt-1"
                                    value={phoneNo}
                                    onChange={(e) => setPhoneNo(e.target.value)}
                                    required
                                />
                            </div>
                            <div className="mb-4">
                                <label className="block text-gray-300">Location</label>
                                <input
                                    type="text"
                                    className="w-full px-4 py-2 bg-gray-700 text-white border border-gray-600 rounded-lg mt-1"
                                    value={location}
                                    onChange={(e) => setLocation(e.target.value)}
                                    required
                                />
                            </div>
                        </>
                    )}
                    <div className="mb-4">
                        <label className="block text-gray-300">Email</label>
                        <input
                            type="email"
                            className="w-full px-4 py-2 bg-gray-700 text-white border border-gray-600 rounded-lg mt-1"
                            value={email}
                            onChange={(e) => setEmail(e.target.value)}
                            required
                        />
                    </div>
                    <div className="mb-4">
                        <label className="block text-gray-300">Password</label>
                        <input
                            type="password"
                            className="w-full px-4 py-2 bg-gray-700 text-white border border-gray-600 rounded-lg mt-1"
                            value={password}
                            onChange={(e) => setPassword(e.target.value)}
                            required
                        />
                    </div>
                    <button type="submit" className="w-full px-4 py-2 bg-blue-500 text-white rounded-lg hover:bg-blue-600 transition duration-300 ease-in-out">
                        {isLogin ? 'Login' : 'Sign Up'}
                    </button>
                    {isLogin && (
                        <button
                            type="button"
                            className="w-full text-right text-gray-300 mt-2 hover:underline"
                            onClick={() => navigate('/forgot-password')}
                        >
                            Forgot Password?
                        </button>
                    )}
                </form>
                <div className="text-center my-4 text-gray-300">Or {isLogin ? 'login' : 'sign up'} with</div>
                <div className="flex justify-around mb-4">
                    <FaFacebook size={32} className="text-white cursor-pointer" />
                    <FaGoogle size={32} className="text-white cursor-pointer" />
                    <FaTwitter size={32} className="text-white cursor-pointer" />
                </div>
                <button
                    type="button"
                    className="w-full text-center text-gray-300 hover:underline"
                    onClick={() => setIsLogin(!isLogin)}
                >
                    {isLogin ? "Don't have an account? Sign Up" : 'Already have an account? Login'}
                </button>
            </div>
            <ToastContainer />
        </div>
    );
};

export default Authentication;
